                        C2112=Ca + Cb*invFe21**2 + invFe21**2*(Ca - Cb*lnJe)
                        C2113=invFe21*invFe31*(Ca + Cb - Cb*lnJe)
                        C2122=invFe21*invFe22*(Ca + Cb - Cb*lnJe)
