    def compute_m(self,u):
        if self.isRigid:
            return 0

        m = 0
        for hexa in self.hexas:
            m += self.m_el(hexa,u)

        return m
    
    def compute_f(self,u, Model):
        force=np.zeros(Model.fint.shape)
        if self.isRigid:
            return 0

        for hexa in self.hexas:
            fint_el = self.fint_el(hexa,u)
            dofs = self.DoFs[hexa].ravel()
            force[dofs] += fint_el
        return force






    def compute_mf_plastic(self,u, Model):
        if self.isRigid:
            return np.zeros(Model.fint.shape),0

        m = 0.0
        force=np.zeros(Model.fint.shape)

        u_ref = Model.REF[0]
        for hex_id,hexa in enumerate(self.hexas):
            # m_el,fint_el = self.mf_el_plastic(hexa,u,self.FPconv[hex_id],self.EPcum[hex_id],hex_id,u_ref)
            m_el,fint_el = self.mf_el_plastic(hexa,u,self.FPconv[hex_id],self.EPcum[hex_id],hex_id,u_ref)
            dofs = self.DoFs[hexa].ravel()
            force[dofs] += fint_el
            m += m_el
            if not np.isfinite(norm(fint_el)):
                m = np.nan
                break

        return force, m

